import Empty from "./Empty";
import Cactus from "./Cactus";

function ObjectCreator({objectIndex}) {
    if (objectIndex == 0) {
        return <Empty>{objectIndex}</Empty>
    }
    if (objectIndex == 1) {
        return <Cactus>{objectIndex}</Cactus>
    }
}

export default ObjectCreator
